import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header>
      <Link to="https://twitter.com/irisdom2092?s=20&t=G0ZqBTvmC2G6XZhDWa2nwA">
        <img src="../Social-logotipos/icons8-twitter-48.png" alt="Logotipo" />
      </Link>
    </header>
  );
}

export default Header;
